package compiler.intermediate.instructions;

/**
 * This instruction is never actually generated by the compiler.
 * It serves as an example of a simple instruction.
 */
public class NoopInstruction extends Instruction {
	@Override
	public String toString() {
		return "NOOP";
	}

    @Override
    public String toMipsAssembler() {
        return "\tnoop\n";
    }
}
